Implement a simple hash table in Java. A hash table is a data structure that stores key-value pairs and allows for efficient retrieval and insertion of data.
Your task is to implement the following functionalities for the hash table:
put(key, value): Insert a key-value pair into the hash table.
get(key): Retrieve the value associated with a given key from the hash table.
remove(key): Remove the key-value pair associated with a given key from the hash table.
To handle collisions, you can use separate chaining or open addressing. Choose a collision resolution technique that suits your implementation.
You can assume that the keys are unique, and the hash table should be able to handle any valid Java data type as keys and values.
