    public void put(Object key, Object value) {
        // Implementation to insert a key-value pair
    }

    public Object get(Object key) {
        // Implementation to retrieve the value associated with a given key
        // Return null if the key is not found
    }

    public void remove(Object key) {
        // Implementation to remove the key-value pair associated with a given key
    }
}
Example Usage:
MyHashTable hashTable = new MyHashTable();
hashTable.put("name", "John");
hashTable.put("age", 30);
hashTable.put(101, "Sample Data");

System.out.println(hashTable.get("name")); // Output: John
System.out.println(hashTable.get("age")); // Output: 30
System.out.println(hashTable.get(101)); // Output: Sample Data

hashTable.remove("age");
System.out.println(hashTable.get("age")); // Output: null (age key-value pair is removed)

Design a thread-safe connection pool for managing database connections in a multi-threaded environment. A connection pool is a crucial component for improving the performance and resource utilization of database connections, particularly in applications where multiple threads may require concurrent database access. Your design should ensure that multiple threads can safely acquire, use, and release database connections without conflicts or contention.
Design Requirements:
Connection Pool Management:
Create and maintain a pool of database connections.
Limit the maximum number of connections in the pool to prevent resource exhaustion.
Thread Safety:
Implement mechanisms to make the connection pool thread-safe.
Ensure that multiple threads can safely request and release connections without data corruption or resource leaks.
Connection Reuse:
Reuse connections to minimize the overhead of creating and destroying connections for each database request.
Connection Validation:
Validate connections before handing them to requesting threads to ensure they are in a usable state.
Timeouts and Wait Strategies:
Handle cases where all connections in the pool are in use, including timeouts and wait strategies for thread contention.
Resource Cleanup:
Ensure that connections are properly released and resources are cleaned up when connections are closed or returned to the pool.
Compatibility:
The connection pool should be compatible with different database systems and connection libraries.
Example:
// Example of using a thread-safe connection pool in Java
ConnectionPool pool = new ConnectionPool("jdbc:mysql://localhost:3306/mydb", "username", "password");
try (Connection connection = pool.getConnection()) {
    // Use the connection for database operations
    // ...
} catch (SQLException e) {
    // Handle exceptions
} finally {
    pool.releaseConnection(connection);
}

Write a function clearAllTimeouts() that efficiently cancels all pending JavaScript setTimeout timers. This function should ensure that after its execution, no previously set timers are left running.
Example 1:
Operations: 
setTimeout(() => console.log("Timer 1"), 1000);
setTimeout(() => console.log("Timer 2"), 2000);
clearAllTimeouts();

Expected Output: No output

Explanation:
- Two setTimeouts are scheduled to log messages after 1 and 2 seconds respectively.
- `clearAllTimeouts()` is called before any of the timers complete.
- As a result, "Timer 1" and "Timer 2" are never logged because their timers were cleared.
Example 2:
Operations: 
const timer1 = setTimeout(() => console.log("This will print"), 500);
const timer2 = setTimeout(() => console.log("This will not print"), 1500);
setTimeout(() => {
    clearAllTimeouts();
}, 1000);

Expected Output: "This will print"
Explanation:
- The first timer is set to log after 500ms and does execute.
- The second timer would log after 1500ms but is cleared by `clearAllTimeouts()`.
- Only the output from the first timer is seen because it completes before the call to `clearAllTimeouts()`.

Optimize a function that filters the keys and values of one object based on another object. The input consists of two objects, source and filterCriteria. Each key in these objects corresponds to an array of values. The function should return a new object containing entries from the source where the array values for each key match any of the array values in the same key of the filterCriteria.
The function should handle cases where keys in the filterCriteria may not exist in the source and should efficiently handle large objects.
Example 1:
Input:
source = {
  "color": ["red", "blue", "green"],
  "size": ["small", "medium"]
}
filterCriteria = {
  "color": ["blue", "yellow"],
  "size": ["medium"]
}

Output:
{
  "color": ["blue"],
  "size": ["medium"]
}

Explanation:
- For "color", both "source" and "filterCriteria" have "blue".
- For "size", both have "medium".
- "green", "red", and "small" do not match any filter criteria and are excluded.
Example 2:
Input:
source = {
  "brand": ["nike", "adidas"],
  "material": ["cotton", "polyester"]
}
filterCriteria = {
  "color": ["black", "white"],
  "brand": ["adidas"]
}

Output:
{
  "brand": ["adidas"]
}

In this JavaScript challenge, your task is to create two fundamental functions for a simple testing framework inspired by Jest. You will implement test() and expect() functions. The test() function should take a description of the test and a callback function that contains the testing code. The expect() function should accept an actual value and return an object with methods to perform different assertions.
Function Signatures:
function test(description: string, callback: Function): void
function expect(actual: any): { toBe: (expected: any) => void }
Example:
Test Case 1:
test('adds 1 + 2 to equal 3', () => {
    const result = 1 + 2;
    expect(result).toBe(3);
});
Expected Output:
Test: adds 1 + 2 to equal 3 - passed
Test Case 2:
test('subtracts 5 - 2 to equal 3', () => {
    const result = 5 - 2;
    expect(result).toBe(3);
});
Expected Output:
Test: subtracts 5 - 2 to equal 3 - passed

Given a node from a sorted circular linked list where the list is sorted in ascending order, write a function to insert a new value into the list so that it remains a sorted circular linked list. The node provided may not necessarily be the smallest value in the circular list. If the list is empty, the new value creates a circular list with only one node.
Define the function as:
Node insert(Node head, int insertVal);
Here, Node is defined as:
class Node {
    int val;
    Node next;
};
Example 1:
Input: head = [3,4,1], insertVal = 2
Output: [3,4,1,2]
Explanation: The list is circular and sorted. The new value 2 fits between 1 and 3, maintaining sorted order.
Example 2:
Input: head = [], insertVal = 1
Output: [1]
Explanation: The list is initially empty. The new node with value 1 forms a single-node circular list.
Example 3:
Input: head = [1], insertVal = 0
Output: [1,0]
Explanation: The list initially contains only one node. The new value 0 is inserted before 1, which is the smallest value.
